import React from "react";

//input: liked : boolean
//output : onClick : 

//simple dom component
const Like = ({ status, onIconClicked }) => {
  const iconName = "fa fa-heart";
  const liked = status ? iconName : `${iconName}-o`;
  return (
    <i
      style={{ cursor: "pointer" }}
      onClick={onIconClicked}
      className={liked}
      aria-hidden="true"
    />
  );
};

export default Like;
